{This masjid has historical importance}

Pathar Mosque, known locally as Naev Masheed  is a Mughal era stone mosque located in the old city of Srinagar, Jammu and Kashmir. It is located on the left bank of the River Jhelum, just opposite the shrine of Khanqah-e-Moula. It was built by Mughal Empress Noor Jehan, the wife of emperor Jehangir.
~~Source Wikipedia~~

